&lt;p&gt;From Wikipedia: &amp;quot;Humayun's tomb (Hindi: हुमायूँ का मक़बरा, Urdu: ہمایون کا مقبره Humayun ka Maqbara) is a complex of buildings built as the Mughal Emperor Humayun's tomb, commissioned by Humayun's wife Hamida Banu Begum in 1562 CE, and designed by Mirak Mirza Ghiyath, a Persian architect.  It was the first garden-tomb on the Indian subcontinent, and is located in Nizamuddin East, Delhi, India, close to the Dina-panah citadel also known as Purana Qila, that Humayun founded in 1533. It was also the first structure to use red sandstone at such a scale. The complex was declared a UNESCO World Heritage Site in 1993.&amp;quot;&lt;/p&gt;

