&lt;p&gt;&lt;a href="http://www.flickr.com/photos/designldg/4684695362/" title="The Infinite Between Two Souls"&gt;&lt;img src="http://farm5.static.flickr.com/4046/4684695362_931ffd0338_m.jpg" width="240" height="240" alt="The Infinite Between Two Souls" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;“Music fills the infinite between two souls”&lt;br /&gt;
(Rabindranath Tagore - Indian Poet, Nobel Prize for Literature in 1913, 1861-1941)&lt;br /&gt;
&lt;br /&gt;
This picture was shot last afternoon at Hauz Khas village in South Delhi.&lt;br /&gt;
In front of the large water tank there are the ruins of a Madrasa from the fourteenth century where I met Jatin who was playing guitar with three of his friends.&lt;br /&gt;
It was at the end of the afternoon and the weather became cool with a few raindrops,  auspicious signs of the end of summer and the forthwith begining of the rainy season.&lt;br /&gt;
Jatin's music brouht an uncommon atmosphere to the place with a few colours reminding me some of the Eagles.&lt;br /&gt;
