&lt;p&gt;&lt;a href="http://www.flickr.com/photos/designldg/4687324685/" title="Secret Places of the Soul"&gt;&lt;img src="http://farm5.static.flickr.com/4062/4687324685_714ceb2676_m.jpg" width="240" height="239" alt="Secret Places of the Soul" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;“Music and rhythm find their way into the secret places of the soul”.&lt;br /&gt;
(Plato - Ancient Greek Philosopher, 428 BC-348 BC)&lt;br /&gt;
&lt;br /&gt;
Into the ruins of a Madrasa from the fourteenth century which stands at Hauz Khas village in South Delhi, I met  Jatin who was playing guitar with three of his friends.&lt;br /&gt;
They were sitting at a window in front of the large water tank.&lt;br /&gt;
Their music was echoing in several rooms of the Mughal building and bringing a pleasant atmosphere.&lt;br /&gt;
There was a storm like those we have at the end of summer forthwithing the begining of the rainy season.&lt;br /&gt;
I took several pictures, it was a nice break in my busy day, this place is so peaceful that I almost forgot I was in Delhi...&lt;br /&gt;
