&lt;p&gt;&lt;a href="http://www.flickr.com/people/loose_grip_99/"&gt;loose_grip_99&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/loose_grip_99/4691347257/" title="India Old Delhi 7th June 1981"&gt;&lt;img src="http://farm5.static.flickr.com/4065/4691347257_f6214143b6_m.jpg" width="240" height="169" alt="India Old Delhi 7th June 1981" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;It's 17.00 at Old Delhi, or Delhi Junction, station and 4-6-2 WP7569 departs eastwards with a passenger train. Built in India based on 1947 design by Baldwin Locomotive Works in the U.S.A these engines ran on the broad or 5ft 6in gauge.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/loose_grip_99/"&gt;loose_grip_99&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/loose_grip_99/4691347263/" title="India Old Delhi 7th June 1981"&gt;&lt;img src="http://farm5.static.flickr.com/4049/4691347263_d11cc68f68_m.jpg" width="240" height="182" alt="India Old Delhi 7th June 1981" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;It may have been too hot to see any condensing steam but the fireman has built up his fire so at least there's some smoke as 4-6-2 WP7569 departs eastwards with a passenger train at 17.00 from Old Delhi (or Delhi Junction) station. Built in India based on 1947 design by Baldwin Locomotive Works in the U.S.A these engines ran on the broad or 5ft 6in gauge.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/loose_grip_99/"&gt;loose_grip_99&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/loose_grip_99/4691347265/" title="India Old Delhi 7th June 1981"&gt;&lt;img src="http://farm5.static.flickr.com/4070/4691347265_952fd690a6_m.jpg" width="240" height="153" alt="India Old Delhi 7th June 1981" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Northern Railways broad gauge (5' 6&amp;quot;) 2-8-2 WG8699 takes water in Old Delhi/Delhi Junction station.&lt;br /&gt;
&lt;br /&gt;
The WG Class was the most common broad-gauge locomotive in post-independence India. Nearly 2 450 of them were built. The first 45 WGs were built by the North British Locomotive Company but later production was transferred to the Chittaranjan Locomotive Works in India.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/loose_grip_99/"&gt;loose_grip_99&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/loose_grip_99/4691347269/" title="India Old Delhi 7th June 1981"&gt;&lt;img src="http://farm5.static.flickr.com/4008/4691347269_5430358cfa_m.jpg" width="240" height="153" alt="India Old Delhi 7th June 1981" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Another broad gauge 2-8-2 WG, number 9719, prepares to depart from Old Delhi/Delhi Junction station with the westward 17.48 passenger train.&lt;br /&gt;
&lt;br /&gt;
I spent about an hour at the station from 17.00 to 18.00 soaking in the atmosphere watching steam trains come and go. Even though the station was quite crowded I had the scene to myself because, of course, no-one else found it the slightest bit out-of-the-ordinary. Today diesel and electric trains rule and all the Indian Railways steam engines are gone.&lt;/p&gt;

