&lt;p&gt;“Because of your smile, you make life more beautiful.”&lt;br /&gt;
(Thich Nhat Hanh - Vietnamese Monk, Peace Activist and Writer, b.1926)&lt;br /&gt;
&lt;br /&gt;
Saurabh is an architect in Delhi, he wanted his portrait by me so we met recently for lunch in Hauz khas village which is in South Delhi.&lt;br /&gt;
As he was living in Milano for a few years, we spoke Italian for fun, he had many expressions and most of all an amazing smile.&lt;br /&gt;
We went outside to the Deer Park and I took several shots.&lt;br /&gt;
I selected this one where everything on his face is smiling, it is the universal language in the world and a source of joy and happiness.&lt;br /&gt;
