&lt;p&gt;Madhyama Subramanian, winner of the UKEFF 2010 with British High Commissioner to India Sir Richard Stagg at a special preview of climate change films on the eve of World Environment Day at the British Council in New Delhi June 4, 2010. Madhyama Subramanian won the award for her film 'Notes from a Green City'. The film looks at how the city of Surat is taking various measures to mitigate climate change and how these successful changes made by the Surat Municipal Corporation can be used as a model for other cities to reduce their emissions. Follow us on &lt;a href="http://www.twitter.com/ukinindia" rel="nofollow"&gt;www.twitter.com/ukinindia&lt;/a&gt;.&lt;/p&gt;

