&lt;p&gt;Vijay Bedi &amp;amp; Ajay Bedi, winners of the UKEFF 2010 with British High Commissioner to India Sir Richard Stagg at a special preview of climate change films on the eve of World Environment Day at the British Council in New Delhi June 4, 2010. They won the award for their film 'Melting Paradise'. The film focuses on the glaciers &amp;amp; wetlands of Jammu &amp;amp; Kashmir. It talks of the Valley's only fresh water sources, the Kolahoi glacier, and further downstream on the wetlands and conveys why the conservation of water resources is an important mitigation strategy against climate change. Follow us on &lt;a href="http://www.twitter.com/ukinindia" rel="nofollow"&gt;www.twitter.com/ukinindia&lt;/a&gt;.&lt;/p&gt;

