&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4731054563/" title="India120"&gt;&lt;img src="http://farm2.static.flickr.com/1152/4731054563_fef3940479_m.jpg" width="240" height="181" alt="India120" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Laxminarayan Temple (also known as the Birla Mandir) is built in honor of Laxmi (Hindu goddess of wealth), and her consort Narayana  (Vishnu, Preserver in the Trimurti).  The temple is adorned with many shrines, fountains, and a large garden. The temple is one of the major attractions of Delhi and attracts thousands of devotees on the Hindu festivals of Janmashtami and Diwali.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4731054711/" title="India121"&gt;&lt;img src="http://farm2.static.flickr.com/1356/4731054711_af8c82600e_m.jpg" width="240" height="181" alt="India121" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Gurudwara Bangla Sahib is the most prominent Sikh gurdwara, or Sikh house of worship, in Delhi.  It is known for its association with the eighth Sikh Guru, Guru Har Krishan, and the pond inside its complex, known as the Sarovar, whose water is considered holy by Sikhs, is known as Amrit;. It was built by Sikh General Sardar Bhagel Singh in 1783, who supervised the construction of nine Sikh shrines in Delhi in the same year, during the reign of Mughal Emperor, Shah Alam II&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4731055001/" title="India123"&gt;&lt;img src="http://farm2.static.flickr.com/1108/4731055001_ed5bf7d1d6_m.jpg" width="240" height="159" alt="India123" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Kitchen at Bangla Sahib (Sikh temple).  Every Sikh temple throughout the world has a Langar (Punjabi for &amp;quot;free kitchen&amp;quot;). This is not a soup kitchen. It's not exclusively for the poor, nor exclusively for the Sikh community. Volunteering in the cooking, serving and cleaning process is a form of active spiritual practice for devotees, but the service they provide asks no religious affiliation of its recipients.&lt;/p&gt;

