&lt;p&gt;School children visit the Qutb Minar complex grounds.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4731055755/" title="India129"&gt;&lt;img src="http://farm2.static.flickr.com/1063/4731055755_00d59f2112_m.jpg" width="240" height="181" alt="India129" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Qutb Minar tower is surrounded by several other ancient and medieval structures and ruins, collectively known as the Qutb complex. The complex is listed as a UNESCO World Heritage Site. It is one of the most popular tourist destinations in Delhi, and was also India's most visited monument in 2006, as it attracted 3.9 million visitors, even more than the Taj Mahal, which drew about 2.5 million visitors&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4731055961/" title="India130"&gt;&lt;img src="http://farm2.static.flickr.com/1101/4731055961_578285be90_m.jpg" width="240" height="159" alt="India130" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Qutb complex initially housed twenty-seven ancient Jain temples that were destroyed and their material used in the construction of the Quwwat-ul-Islam Mosque in the Qutb complex&lt;/p&gt;

