&lt;p&gt;Jama Masjid of Old Delhi, is the largest and best-known mosque in India.  It was commissioned by the Mughal  Emperor Shah Jahan, builder of the Taj Mahal, and completed in the year 1656 AD.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4731697674/" title="India127"&gt;&lt;img src="http://farm2.static.flickr.com/1226/4731697674_316b4970fd_m.jpg" width="240" height="181" alt="India127" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Qutub Minar tower is at 72.5 meters (237.8 ft) the world's tallest brick minaret. Construction commenced in 1193 under the orders of India's first Muslim ruler Qutb-ud-din Aibak, and the topmost story of the minaret was completed in 1386 by Firoz Shah Tughluq. The Qutub Minar is notable for being one of the earliest and most prominent examples of Indo-Islamic architecture.&lt;/p&gt;

