&lt;p&gt;Rashtrapati Bhawan (President House }&lt;br /&gt;
This official residence of the President of India was formerly known as the Viceregal Palace. Rashtrapati Bhawan is the highlight of Lutyen's New Delhi and was completed in 1929 at a cost of Rs.12,53,000. Located in an area of 130 hectares, the palace has 340 rooms. At one time, 2,000 people were required to look after the building and serve the Viceroy's household&lt;/p&gt;

