&lt;p&gt;An old picture I took in 1982 while on vacation in India. Not too many places will you encounter someone on the sidewalk who pops open a basket and up jumps two live cobra's. It took me a while to get my heart beat back, but I was able to get one shot in. I scanned the fading photo and cleaned it up.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/47276022@N00/"&gt;Pradeep Kaushik&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/47276022@N00/4762362395/" title="Kutub Minar"&gt;&lt;img src="http://farm5.static.flickr.com/4117/4762362395_db0889a8b7_m.jpg" width="240" height="223" alt="Kutub Minar" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Qutb Minar is tall, with 379 steps leading to the top. The diameter of the base is 14.3 meters, while the top floor measures 2.75 meters in diameter. Surrounding the building are many fine examples of Indian artwork from the time it was built in 1193. The name of this tower is given as Alai Minar. It is made of red sandstone all the way except for two stories at the top. This part is of white marble and was made by Firoz Shah Tughlaq. He had decided to put a prominent finish to the magnificent minar.&lt;/p&gt;

