&lt;p&gt;Este edificio de Delhi constituye una gran flor de loto de cemento blanco y mármol. Tiene nueve lados y siete estanques simbolizando el todo, la unicidad y la unidad. La flor de loto es el símbolo tradicional hindú de pureza y santidad. Espectacular e icono de la modernidad, el templo del loto -diseñado por el aquitecto iraní Fariborz Sahba- y maravilla arquitectural contemporánea es llamado por muchos como el Taj de la India moderna. Fue construído como templo de culto para la religión de Baha'i. Multiconfesional , con cabida para 2.500 personas y terminado en 1986 , intenta aunar varias religiones bajo sus pétalos , entre jardines fuentes y espejos (2010)&lt;/p&gt;

