&lt;p&gt;&lt;a href="http://www.flickr.com/photos/ramesh_lalwani/4785342543/" title="Teen Murti Bhawan"&gt;&lt;img src="http://farm5.static.flickr.com/4075/4785342543_f7ed83b1a0_m.jpg" width="240" height="160" alt="Teen Murti Bhawan" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Teen Murti Bhavan in Delhi, India, housed the first Prime Minister of India, Jawaharlal Nehru. It was designed by Robert Tor Russel, the architect of Connaught Place and of the Eastern and Western Courts on Janpath.&lt;br /&gt;
Today, the complex is also home to the Centre for Contemporary Studies, headquarters of Jawaharlal Nehru Memorial Fund, (estb 1964), Nehru Memorial Library, and also the Nehru Fellowship, also on the ground stand the Nehru Planetarium, inaugurated in 1984.&lt;br /&gt;
The Bhavan was originally known as Flagstaff House and was the residence of the Commander-in-Chief of the British Forces in India.&lt;br /&gt;
However, after Independence (1947) the house was taken over as the residence of the Prime Minister. On Nehru's death, the house was converted into a national memorial comprising a library and a museum. The library is one of the finest ones for information on modern Indian history.&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Teen Murti (three statues), outside Teen Murti Bhavan, which gives the building its name&lt;br /&gt;
The Bhavan is closed to the public on Mondays and on all public holidays. One of the four Nehru Planetariums in India, is also situated in Teen Murti House. It was inaugurated by the then Prime Minister, Smt. Indira Gandhi, on February 6th, 1984. The planetarium's sky theater is used for screening shows and as a galler&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/ramesh_lalwani/"&gt;ramesh_lalwani&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/ramesh_lalwani/4785344353/" title="Teen Murti and Rashtrapati Bhawan"&gt;&lt;img src="http://farm5.static.flickr.com/4096/4785344353_aedd74e3ff_m.jpg" width="240" height="160" alt="Teen Murti and Rashtrapati Bhawan" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Teen Murti (&amp;quot;three statues&amp;quot;) Memorial, which stands on the road junction in front of its extensive grounds. The memorial was built in memory of the Indian soldiers who perished in World War I.&lt;/p&gt;

