&lt;p&gt;Il Qutb Minar è il più alto minareto in mattoni del mondo.&lt;br /&gt;
&lt;br /&gt;
L'edificio è alto 72,5 metri, il diametro è di 14,3 metri alla base, mentre misura 2,75 metri alla sommità. È composto da cinque piani che si affacciano in altrettante balconate. Esso è il più famoso dei monumenti che compongono il Complesso di Qutb, che nel 1993 è stato inserito nell'elenco dei Patrimoni dell'umanità dell'UNESCO.&lt;/p&gt;

