&lt;p&gt;&lt;a href="http://www.flickr.com/photos/shammi-60/4797797761/" title="Euphorbia x lomi 'Sweet Heart' 03044"&gt;&lt;img src="http://farm5.static.flickr.com/4120/4797797761_6c9e841505_m.jpg" width="240" height="181" alt="Euphorbia x lomi 'Sweet Heart' 03044" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;
Euphorbia x lomi 'Sweet Heart' (Supergrandiflora Sweet Heart) - This evergreen succulent shrub grows to 2 to 3 feet tall with gray spiny stems that sparsely hold small oblong pale green leaves at the tips. Also at the tips of the branches are the pairs of pink flowers (bracts). The supergrandiflora series were bred in Thailand by crossing Euphorbia lophogona with Euphorbia millii and selections were made for good color and large bracts. These hybrids are correctly known as Euphorbia x lomi, a hybrid epithet formed from the first two letters of the parent species, but are generally marketed as Supergrandiflora Hybrids. The cultivar 'Sweet Heart' has much larger flower bracts (the colorful petal-like leaves that surround the true flowers) than those typically surrounding the flowers of the common red crown of thorns. These bracts are a pale pink fading to near white flowers and can be present year-round in mild climates but are most abundant in the spring. It has low water needs and does best in the full sun or light shade.&lt;/p&gt;

