&lt;p&gt;&lt;a href="http://www.flickr.com/photos/kd_saurav/4812496477/" title="Tomb of Isa Khan Niazi"&gt;&lt;img src="http://farm5.static.flickr.com/4075/4812496477_6db87c2b38_m.jpg" width="240" height="192" alt="Tomb of Isa Khan Niazi" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Isa Khan Niazi (Pashto: عیسی خان نيازي) was an Afghan noble in the court of Sher Shah Suri and his son Islam Shah Suri, of the Sur dynasty, who fought the Mughal Empire.&lt;br /&gt;
&lt;br /&gt;
Tomb of Isa Khan:' Isa Khan's tomb built during his lifetime ca 1547-48 AD, is situated near the Mughal Emperor Humayun's Tomb complex in Delhi which was built later between 1562-1571 AD. Built within an enclosed octagonal garden, it is bears striking resemblance to other tombs of Sur dynasty monuments in the Lodhi Gardens. This octagonal tomb has distinct ornamentation in the form of canopies, glazed tiles and lattice screens and a deep veranda, around it supported by pillars. It stand south of the Bu Halima garden just as vistor's enter the complex. An inscription on a red sandstone slab indicated that the tomb is of Masnad Ali Isa Khan, son of Niyaz Aghwan, the Chief chamberlain, and was built during the reign of Islam Shah Suri, son of Sher Shah, in 1547-48 A.D. &lt;br /&gt;
&lt;br /&gt;
Mosque of Isa Khan: Across this tomb standing at the edge of the complex, lies a mosque, built along with the tomb, known as Isa Khan's mosque with noticeable mehrabs. Many of the architectural details present in these structures can be seen further evolved in the main Humayun's tomb, though on a much grander scale such as the tomb being placed in a walled garden enclosure.&lt;br /&gt;
&lt;br /&gt;
--wiki&lt;/p&gt;

