&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
This is the Inside area of the Red Fort . Its called the Diwan - e - aam meaning a &amp;quot;Hall of Public Audience,&amp;quot;&lt;br /&gt;
&lt;br /&gt;
The Emperor used this place to address the general public and nobility. He would sit on a throne and dispense justice based on the petitions presented by his ministers.&lt;br /&gt;
 Built of sandstone covered with shell plaster polished to look like ivory, the 80 x 40 feet hall is sub-divided by columns. The Mughal emperors would hold court here and meet dignitaries and foreign emissaries. The most imposing feature of the Diwan-e-Aam is the alcove in the back wall where the emperor sat in state on a richly carved and inlaid marble platform. In the recess behind the platform are fine examples of Italian pietra-dura work.&lt;br /&gt;
&lt;br /&gt;
This is the view from the side of the water body enclosed from the sides where fountains adorned the area flanked by well manicured greens .&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
A scene before heavy rains came down.&lt;/p&gt;

