&lt;p&gt;&lt;a href="http://www.flickr.com/photos/kalsnchats/4839817812/" title="Side view  Of the Red Fort - A bit Closer"&gt;&lt;img src="http://farm5.static.flickr.com/4154/4839817812_b11b02e308_m.jpg" width="240" height="160" alt="Side view  Of the Red Fort - A bit Closer" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The main entrance to the Lal Quila is through the Lahori Gate. Beyond the gate, there is a roofed passage, flanked by arcaded apartments leading to the palaces, known as Chhatta Chowk. These apartments are now used as shops. Besides these, there are three more gates on other sides, which are kept closed now. The master builders of the Red Fort were Hamid and Ahmad. Visitors are allowed only in a part of Red Fort, as the army occupies the rest of it. &lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://asi.nic.in/asi_monu_tktd_delhi_redfort.asp" rel="nofollow"&gt;About RED FORT&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://bighugelabs.com/flickr/onblack.php?id=4839817812&amp;amp;size=large" rel="nofollow"&gt;For Some of you Big is Better for sure !&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/kalsnchats/"&gt;kalsnchats&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/kalsnchats/4839817828/" title="RED TEE  @ Red Fort  Side view  Of the Red Fort"&gt;&lt;img src="http://farm5.static.flickr.com/4150/4839817828_fd6c4d5072_m.jpg" width="160" height="240" alt="RED TEE  @ Red Fort  Side view  Of the Red Fort" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The perimeter of the  FORT  strong ramparts is about 2.41 km. Red Fort rises to a height of 33.5 m on the town side and 18 m along the river. A wide moat surrounds the fort, which was originally connected with the river and was always filled with water. The two main gateways, known as Lahori Gate and Delhi Gate (named so, as they face Lahore and Delhi respectively), are three storeys high and are flanked by semi-octagonal towers. They are situated on the centre of the western and southern sides respectively. &lt;br /&gt;
