&lt;p&gt;National Highway 8 (NH 8), is a National Highway in India that connects the Indian capital city of New Delhi with the Indian Financial capital city of Mumbai.  The Delhi-Gurgaon Expressway is a part of NH 8. Delhi-Gurgaon Expressway is a 28 km (17 mi) long access-controlled toll expressway connecting Delhi, the national capital of India, and Gurgaon, an important satellite city of Delhi.&lt;br /&gt;
&lt;br /&gt;
This expressway is the busiest inter-city route in India and handles more than 180,000 PCUs daily.&lt;br /&gt;
&lt;br /&gt;
-It Starts at Dhaula Kuan in Delhi and terminates on the outskirts of Gurgaon (Manesar).&lt;br /&gt;
-The road has 11 flyovers and overpasses.&lt;br /&gt;
-Four toll plazas including the 32-lane toll plaza at Delhi-Haryana Border, which is the biggest toll plaza in South Asia and the second biggest in the Asia.&lt;br /&gt;
-CCTV surveillance till IGI airport.&lt;br /&gt;
-SOS one-way telephones at every 1.5 km (0.93 mi)&lt;br /&gt;
-Elevated sections of the expressway will be open only for vehicles capable of attaining speeds of 80–100 km/h.&lt;br /&gt;
-47 km (29 mi) of service roads for local and slow moving traffic.&lt;/p&gt;

