&lt;p&gt;&lt;a href="http://www.flickr.com/photos/scottnorsworthy/4847613305/" title="Bahá'í House of Worship, Lotus Temple, Delhi"&gt;&lt;img src="http://farm5.static.flickr.com/4153/4847613305_14c62a647a_m.jpg" width="160" height="240" alt="Bahá'í House of Worship, Lotus Temple, Delhi" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Inspired by the form of the lotus flower, the mother temple of the Bahá'í faith in the Indian Subcontinent is located in Delhi. Completed in 1986, the temple has won numerous awards and has become a significant tourist attraction, in addition to continuing to serve as a place of worship.&lt;br /&gt;
&lt;br /&gt;
Designed by Iranian architect Fariborz Sahba who now lives in Canada, the temple shares certain similarities with all Bahá'í houses of worship. Composed of 27 free-standing marble-clad petals, the temple uses groups of three petals to form a nine sided circular building. The temple itself is devoid of any representational symbols, images or statues and has no pulpit or altar. No ritualistic ceremonies or sermons can be delivered here, only scripture can be read.&lt;br /&gt;
&lt;br /&gt;
Although I did not have a chance to learn much about the Bahá'í faith, their outlook seems exceedingly accepting and welcoming. The temple is open to absolutely anyone, regardless of one's religion or any other distinction. Only eight houses of worship have been built worldwide (including on in Turkmenistan which has since been destroyed). &lt;br /&gt;
&lt;br /&gt;
The Bahá'í faith emphasizes the spiritual unity of humankind and sees religious history as having unfolded through a series of divine messengers including Abraham, Buddha, Jesus, Mohammed and others, each who established a religion suited to the needs of the time and capacity of the people. Humanity is understood as a process of collective evolution. (wikipedia)&lt;/p&gt;

