The Masjid-i Jahān-Numā (Persian:    , the 'World-reflecting Mosque'), commonly known as the Jama Masjid of Delhi, is the principal mosque of Old Delhi in India. Commissioned by the Mughal Emperor Shah Jahan, builder of the Taj Mahal, and completed in the year 1656 AD, it is the largest and best-known mosque in India. It lies at the origin of a very busy central street of Old Delhi, Chandni Chowk.&lt;br /&gt;
&lt;br /&gt;
The later name, Jama Masjid, is a reference to the weekly Friday noon congregation prayers of Muslims, Jummah, which are usually done at a mosque, the &amp;quot;congregational mosque&amp;quot; or &amp;quot;jāmi' masjid&amp;quot;. The courtyard of the mosque can hold up to twenty-five thousand worshippers. The floor of the mosque is covered with white and black marble ornamented to imitate the Muslim prayer mat; a thin black marble border is marked for the worshippers, which is three feet long and 1.5 feet wide. In total there are 899 such spaces marked in the floor of the mosque.&lt;/p&gt;

