&lt;p&gt;The question asked by the quiz master Ms.Shabana was “ who was the first education Minister of India ? ” Amidst a 100 Muslim and Non Muslim children gathered for MELJOL an “environment building” program, this cute little girl gave the right answer “Maulana Abul Kalam Azad”. As she was trying to respond, from far through zoom I took this picture as I saw a dream in the eyes of this little child coming from the C-Block Madrassa of Jehangirpuri. Creating a non-threatening, mutually respectful environment among children of all faiths is MEGA-SkY projects one of the objectives.&lt;/p&gt;

