&lt;p&gt;&amp;quot;I spent two decades here. I love my university. I have always loved it and will continue to do so no matter what. But i wonder if they have stopped loving me because i am gay.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
Dr. Shrinivas Ramachandra Siras &lt;br /&gt;
&lt;br /&gt;
Dr. Siras was a professor at Aligargh Muslim University (AMU), Uttar-Pradesh. He was found dead at his home on April 7th 2010. He had been suspended by his university on charges of &amp;quot;gross misconduct&amp;quot; after he was filmed having sex with another man, at his rented accommodation in Aligarh. A great number of intellectuals, both from the university and outside believe that Dr. Siras committed suicide because of pressure from AMU.&lt;br /&gt;
&lt;br /&gt;
That day of April 2010, some of his friends, colleagues and students had gathered in Connaught Place, New Delhi, to ask for justice and right to privacy, and pay their last respect to a man whose only fault was to be gay. &lt;br /&gt;
&lt;br /&gt;
