&lt;p&gt;&lt;a href="http://www.flickr.com/photos/ramitbatra/4987379501/" title="Dulha + Sehra"&gt;&lt;img src="http://farm5.static.flickr.com/4154/4987379501_151198f2d6_m.jpg" width="240" height="240" alt="Dulha + Sehra" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Sehera is the Head-gear worn by the Dulha (Groom), in Hindu Weddings, made of garlands hanging from a silver helmet-like contraption, generally tied on a turban.&lt;br /&gt;
&lt;br /&gt;
A lot of married Indian men joke about Why such a custom exists. Even more so, because the Mare on which the groom is sitting, is wearing a similar headdress.&lt;br /&gt;
&lt;br /&gt;
But such is the beauty of Hindu Weddings. These small details (though mostly crazy) make the whole affair - simply beautiful!&lt;br /&gt;
&lt;br /&gt;
-&lt;br /&gt;
&lt;br /&gt;
Yes. I too wore a similar head gear (which weighed about two and a half kilos [5lbs]) at my wedding! And yes, I didn't stop complaining.&lt;br /&gt;
-&lt;br /&gt;
