&lt;p&gt;Yamuna catchment area in northern India has been getting unprecedented  monsoon rains during September 2010,causing the river to  cross danger mark. The water level at old rail cum road bridge in Delhi was 205.42 meter on Monday morning which is above danger mark of 204.83 meters. Adjacent state of Haryana has released 2.57 lakh cusec of water from Hathnikund barrage on Sunday night and. it is expected that water will reach Delhi in 72 hours causing further rise in water level..Delhi Government has already taken necessary steps to move people from low lying areas to safer places and provided them with tented shelters and drinking water. Some social organisations are providing free food to affected people.&lt;/p&gt;

