&lt;p&gt;I was on my way to Jama Masjid to capture a glimpse of Maghrib Namaz —the final offering after the last Iftaar of Ramzaan. I may not have been able to reach the place in time, but the tint in the sky, which had turned a resplendent red from the day's gloomy greys, told me that people's prayers had reached up there.&lt;br /&gt;
